import {
    LOGIN_USER,
    NAVBAR_USER,
    REGISTER_USER
} from '../_actions/types';

export default function (state={}, action){
    switch(action.tyoe) {
        case LOGIN_USER:
            return {...state, loginSucess : action.payload}
        case REGISTER_USER:
            return {...state, register : action.payload}
        case NAVBAR_USER:
            return {...state, navbar : action.payload}


        default:

            return state;



    }

}
